import React from 'react';
import '../styles/table.css';

const AgentTable = ({ agents }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Agent ID</th>
          <th>Name</th>
          <th>Status</th>
          <th>Owner</th>
          <th>Type</th>
          <th>Framework</th>
          <th>Health</th>
          <th>Deployed At</th>
        </tr>
      </thead>
      <tbody>
        {agents.map(agent => (
          <tr key={agent.agent_id}>
            <td>{agent.agent_id}</td>
            <td>{agent.agent_name}</td>
            <td>{agent.status}</td>
            <td>{agent.owner}</td>
            <td>{agent.agent_type}</td>
            <td>{agent.framework}</td>
            <td>{agent.health}</td>
            <td>{agent.deployed_at}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default AgentTable;
